/*Table structure for table `merchant` */

DROP TABLE IF EXISTS `merchant`;

CREATE TABLE `merchant` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '商家编号',
  `merchant_no` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '商铺编号',
  `shop_name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '商铺名称',
  `shop_telephone` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '商家电话',
  `shop_address` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '商家地址',
  `delivery_time` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '商家配送时间范围',
  `merchant_evaluation` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '商铺评价',
  `merchant_food_safety_archives` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '商品食品安全档案',
  `merchant_provides_delivery_fees` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '商品是否提供 配送费   1  提供配送费 顾客无需支付   0  否  需要支付配送费',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin ROW_FORMAT=COMPACT;

