DROP TABLE IF EXISTS `tb_courier`;

CREATE TABLE `tb_courier` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '骑手编号',
  `name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '骑手姓名',
  `telephone` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '骑手电话',
  `workset_location` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '骑手所在站点名称',
  `cur_location` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT ' 快递员当前所在的位置  经纬度',
  `on_job` int(11) DEFAULT NULL COMMENT ' 快递员 是否在职   0  休息  1  上班',
  `score` double(4,2) DEFAULT NULL COMMENT '骑手评分',
