/*Table structure for table `tb_courier_trade_order` */

DROP TABLE IF EXISTS `tb_courier_trade_order`;

CREATE TABLE `tb_courier_trade_order` (
  `trade_no` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '运单编号',
  `total_amount` double DEFAULT NULL COMMENT '运单金额',
  `courier_id` bigint(20) DEFAULT NULL COMMENT '骑手编号',
  `order_number` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '运单对应的订单号',
  `waybill_status` int(11) DEFAULT NULL COMMENT '运单状态：0 商家未接单，未派送，运单未生成\r\n1 调度成功，骑手未接单\r\n2 骑手接单，待取货状态\r\n3 待送达 骑手到商家取完货，运单属于待送达状态\r\n4 已送达 运单完成\r\n5 运单取消：顾客申请取消订单',
  `trade_create_time` datetime DEFAULT NULL COMMENT '运单创建时间',
  `trade_complete_time` datetime DEFAULT NULL COMMENT '运单完成时间',
  `trade_cancel_time` datetime DEFAULT NULL COMMENT '运单取消时间',
  `over_time` datetime DEFAULT NULL COMMENT '运单超时时间',
  `shop_address` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '商家地址',
  `remark` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '运单备注',
  `customer_address` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '客户地址',
  `customer_expected_delivery_time` datetime DEFAULT NULL COMMENT '预计送达时间',
  `customer_name` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '客户名称',
  `shop_name` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '店铺名称',
  `to_be_meal_time` datetime DEFAULT NULL COMMENT '商家出餐时间',
  `telephone` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '客户手机号',
  `income` double DEFAULT '0' COMMENT '外卖员提成',
  PRIMARY KEY (`trade_no`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=122 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin ROW_FORMAT=COMPACT;

